import React from 'react';

const Education = () => (
  <section className="education" id="education">
    <h2>Education</h2>
    <div className="edu-item">
      <img src="/icons/code.svg" alt="Education Icon" />
      <div>
        <h3>Bachelor of Science in Computer Science (BSCS)</h3>
        <p>PAF-KIET UNIVERSITY, Karachi Institute of Economics and Technology</p>
        <span>October 2022 - Present</span>
      </div>
    </div>
  </section>
);

export default Education;
